import React from 'react';
import {
  Popconfirm,
  Button
} from 'antd'


export default PanelButton = (props) => {

  const { text, onClick } = props;
  return (
    <Popconfirm placement="right" title={text} onConfirm={onClick} okText="Yes" cancelText="No">
      <Button>Right</Button>
    </Popconfirm>
  )
}
